// src/HomePage.js
import { useNavigate } from 'react-router-dom';

export default function HomePage() {
  const navigate = useNavigate();

  return (
    <main className="min-h-screen bg-[#0f172a] text-white flex flex-col items-center justify-center px-6">
      <div className="flex flex-col items-center gap-6">
        <img
          src="/logo.png.jpg"
          alt="logo"
          className="h-24 w-24 rounded-2xl shadow-lg"
        />
        <h1 className="text-5xl font-extrabold text-[#3ddad7]">Safeswap</h1>

        <button
          onClick={() => alert("Funcionalidade de compra ainda será implementada")}
          className="mt-8 bg-gradient-to-r from-green-500 to-emerald-600 hover:from-green-400 hover:to-emerald-500 text-white px-16 py-5 rounded-2xl text-2xl font-bold transition duration-300 transform hover:scale-105 shadow-lg"
        >
          Comprar ingressos
        </button>

        <button
          onClick={() => navigate('/revenda')}
          className="text-[#3ddad7] hover:text-[#67e8f9] text-base underline underline-offset-4 transition mt-4"
        >
          Intermediação de revendas
        </button>
      </div>
    </main>
  );
}
